import "./index.css";
import './App.css';

function App() {
  return (

  
      <div class="grid-container">

        <div class="choose-me">
          <h1>Choose an option</h1>
        </div>

        <div class="delivery-option-1">
          <img id="pickup" src="/img/map-pin.svg" alt="map-pin"/>
          <h2>I'm picking it up myself</h2>
          <h3>0kr</h3> 
        </div>

        <div class="delivery-option-2">
          <img id="truck" src="/img/truck.svg" alt="delivery-truck"/>
          <h2>Home delivery</h2>
          <h3>50kr</h3>
        </div>

        <div class="button-1">
          <button id="buttonsRed">Back to shoppingcart</button>
        </div>


    </div>

  );
}

export default App;
